  return (
    <div className="welcome-page">
      <video autoPlay muted loop playsInline>
        <source src="../" type="video/mp4" />
        Your browser does not support the video tag.
      </video>
      <AnimatedComponent />
    </div>
  );
}

export default WelcomePage;
